export function Dashboard() {
  const dispatch = useDispatch();
  const users = useSelector(getUsers);

  useEffect(() => {
    dispatch(userActions.getUsers());
  }, [dispatch]);

  return (
    <div className="Dashboard">
      <h1>Dashboard</h1>
      {}
    </div>
  );
}
